import React from "react";
import PropTypes from "prop-types";
import classNames from "classnames";
import Toggle from '../../Toggle';
import { NavLink } from "react-router-dom";
const namespace = "navbar";

const NavBar = ({ className }) => {
  const componentClassNames = classNames(namespace, className);

  return (
    <nav className={componentClassNames}>
      {/* Aqui deberan agregar los liks correspondientes a las rutas definidas */}
      {/* Deberan implementar ademas la logica para cambiar de Theme con el button */}
      <ul className={`${namespace}-list`}>
        <li className={`${namespace}-list__item`}>
          <NavLink
            to="/"
            className={({ isActive }) =>
              `${className}-list__link ${
                isActive ? `${className}-list__link--active` : ""
              }`
            }
          >
            Home
          </NavLink>
        </li>
        <li className={`${namespace}-list__item`}>
          <NavLink
            to="/favorites"
            className={({ isActive }) =>
              `${namespace}-list__link ${
                isActive ? `${namespace}-list__link--active` : ""
              }`
            }
          >
            Favorites
          </NavLink>
        </li>
        <li className={`${namespace}-list__item`}>
          <NavLink
            to="/about"
            className={({ isActive }) =>
              `${namespace}-list__link ${
                isActive ? `${namespace}-list__link--active` : ""
              }`
            }
          >
            About
          </NavLink>
        </li>
      </ul>
      <Toggle />
    </nav>
  );
};

NavBar.propTypes = {
  className: PropTypes.string,
};

NavBar.defaultProps = {
  className: "",
};

export default NavBar;
